import React from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { useEffect } from 'react'
import { searchPokemonsById } from '../store/actions'
import DetailsPresent from './DetailsPresent.jsx'

export default  function  Details(props) {
  let details = useSelector((state) => state.details)
  let dispatch = useDispatch()
  useEffect(() =>  {
    dispatch(searchPokemonsById(props.id))
  }, [])
  console.log(details)
  return (
    
    <div>   
        {
          details.map(details => 
            <DetailsPresent 
            name={details.name} 
            id={details.id}
            image={details.name}
            defense={details.image}
            attack={details.attack}
            height={details.height}
            weight={details.weight}
            speed={details.speed}
            type={details.name}
            />)
        }

    </div>
  )
}
